VALUES ('3222475311017', 'Sandwich Poulet Caesar - Sauce au fromage Italien', 'Pain de mie aux céréales 40% [céréales 22,8% (farine de _blé_ - farine de maïs - farine de _seigle_ - farine d\'_épeautre_ - farine d\'_orge_ - farine de riz - farine d\'_avoine_ - germe de _blé_ - fibre de _blé_) - eau - son de _blé_ - graines (lin brun - _sésame_) - sucre - huile de colza - levure - _gluten de blé_ - _blé_ malté concassé - sel - farine de _seigle_ maltée - levain de _seigle_ déshydraté et dévitalisé - émulsifiant : E471 - agent de traitement de la farine : E300] - poulet rôti traité en salaison décongelé 25,8% [filet de poulet 24,8% (origine : UE ou Hors UE) - dextrose - sel] - tomates décongelées 10% - _oeufs_ durs 7,5% (_œufs_ - acidifiants : E330, E260 - sel) - mayonnaise allégée en matières grasses [eau - huile de colza 1,5% - vinaigre d\'alcool - jaune d\'_œuf_ - amidon transformé - sucre - _moutarde_ de Dijon (eau - graines de _moutarde_ - vinaigre d\'alcool - sel ) - sel - _lait_ écrémé reconstitué - acidifiant : E330 - épaississant : E415] - yaourt au _lait_ écrémé brassé - _fromage_ frais nature (_fromage_ frais - sel) -  tomates semi-déshydratées - _parmigiano reggiano_ au _lait_ cru 0,6% - huile de colza - sel - origan - ail. Traces de crustacés, poissons et _soja_.', 'https://static.openfoodfacts.org/images/products/322/247/531/1017/front_fr.3.400.jpg', '5.5', '1.6', '24', '4.5', '2.5', '12', '1', '0.393700787401575', '', '0');

