_ de _lait_ - stabilisant : carraghénanes) - queue d\'_écrevisse_ de Louisiane 19% (_écrevisse_ 19%, sel) - _comté_ 7% - chorizo 6,3% (viande et gras de porc  - piment - sel - dextrose - épices et extraits de plantes aromatiques - ferments lactiques - conservateurs : ascorbate de sodium, nitrite de sodium) - purée de tomate - huile de tournesol - amidon transformé de pomme de terre - persil - sel - poivre. (Pourcentages exprimés sur la mini tartelette). 4 Choux au bloc de foie gras et parmesan 18,3%. chou 57.9% (_œuf_ - eau - farine de _blé_ - _lait_ demi écrémé - _beurre_ - persil - sel - noix de muscade - poivre - gluten de _blé_) - garniture 42.1% [bloc de foie gras de canard 21% (foie gras de canard 18% - eau - Armagnac - sel - poivre - antioxydant : ascorbate de sodium - conservateur : nitrite de sodium) - _crème_ (_crème_ de _lait_ - stabilisant : carraghénanes) - chapelure (farine de _blé_ - eau - sel - levure) - _parmesan_ râpé 2,6% - amidon transformé de pomme de terre - jaune d\'_œuf_ salé (jaune d\'_œuf_ - sel) - protéines de _lait_]. (Pourcentages exprimés sur le chou au bloc de foie gras et parmesan).4 Mini blinis aux 2 saumons et au zeste de citron semi confit 17,1%. Mini blinis 42% [_lait_ demi écrémé - farine de _blé_ - huile de colza - eau - _œuf_ salé sucré (_œuf_ - sel - sucre) - _oeuf_ sucré en poudre (_œuf_ - sirop de glucose) - _crème_ fraîche - farine de blé noir - sucre - huile de tournesol - levure de boulangerie - gluten de _blé_ - sel] - _crème_ fraîche 28% - miettes de _saumon_ cuit 17% - zeste de citron semi confit 5,6% (zeste de citron 3,8% - sirop de glucose-fructose - sucre - antioxydant : acide ascorbique - correcteur d\'acidité : acide citrique) - émietté de _saumon_ fumé 1,5% (_saumon_ atlantique 1,4% - sel) - amidon transformé de pomme de terre - ciboulette - jus de citron 0,7% - amidon transformé de maïs - sel - huile de colza - épaississants : gomme xanthane, gomme guar. (Pourcentages exprimés sur le mini blini aux 2 saumons). Traces de : céleri, lupin, mollusques, moutarde, soja, sésame et autres _fruits à coque._', 'https://static.openfoodfacts.org/images/products/322/247/544/5828/front_fr.4.400.jpg', '24', '13', '17', '6.5', '', '11', '1.4', '0.551181102362205', '', '0');

