_ demi écrémé - chocolat de couverture 8.2% (pâte de cacao - sucre - beurre de cacao - émulsifiant : lécithine de _soja_ - arôme naturel de vanille) - chocolat blanc 7.6% (sucre - beurre de cacao - _lait_ en poudre - _lactose_ - _lait_ écrémé en poudre - émulsifiant : lécithine de _soja_) - beurre de cacao - fécule de manioc - huile de tournesol - farine de _blé_. (Pourcentages exprimés sur la tartelette caramel filet de chocolat). Moelleux pommes _amandes_ 22% : compote de pommes pâtissière 26% (pommes 19% - sucre) - _œufs_ - _amande_ en poudre 18% - sucre - _amande_ effilée 12% - _beurre_. (Pourcentages exprimés sur le moelleux pommes amandes) Traces de céleri, moutarde, sésame et autres _fruits à coque._', 'https://static.openfoodfacts.org/images/products/322/247/544/5842/front_fr.4.400.jpg', '26', '15', '41', '25', '3.9', '3.5', '0.12', '0.047244094488189', '', '1');

